class Node {

  constructor(c, root) {
    this.connectingNodes = new Array(CONNECTING_LETTER_COUNT);
    this.character = c;
    for(var i = 0; i < CONNECTING_LETTER_COUNT; i++) {
      this.connectingNodes[i] = root;
    }
    this.outputNode = false;
    this.outputWord = undefined;
  }

}

class SpecializedTrie {

  constructor() {
    this.root = new Node(undefined, undefined);
    for(var i = 0; i < CONNECTING_LETTER_COUNT; i++) {
      this.root.connectingNodes[i] = this.root;
    }
    this.currentNode = this.root;
    this.initialColonNode = new Node(':', this.root);
    var y = ":".charCodeAt();
    // console.log(":  " + y);
    this.root.connectingNodes[y] = this.initialColonNode;
  }


  add_word(str) {
    str += ":";
    var cn = this.initialColonNode;
    for(var i = 0; i < str.length; i++) {
      var t = str.charCodeAt(i);
      // console.log(str[i] + "   " + t);
      if(t < 128 && cn.connectingNodes[t].character == str[i]) {
        cn = cn.connectingNodes[t];
      } else {
        var newCN = new Node(str[i], this.root);
        cn.connectingNodes[t] = newCN;
        cn = newCN;
      }
    }
    cn.outputNode = true;
    cn.outputWord = str.substr(0, str.length - 1);
    // console.log(cn);
  }

  next(c) {
    var t = c.charCodeAt();
    if(t < CONNECTING_LETTER_COUNT) {
      this.currentNode = this.currentNode.connectingNodes[t];
      return this.currentNode.outputNode;
    } else {
      this.currentNode = this.root
      return false;
    }
  }

  curr_word() {
    return this.currentNode.outputWord;
  }

  reset() {
    this.currentNode = this.root;
  }

}

class ReferenceCollection {

  constructor() {
    this.references = [];
    this.add_ref_func = undefined;
    this.length = 0;
  }

  change_url(i, new_url) {
    this.references[i].setAttribute('src', new_url);
  }

  add_reference(ref) {
    this.add_ref_func =ref;
  }

  grow(len) {
    for(var i = this.references.length; i < len; i++) {
      this.references.push(this.add_ref_func());
    }
  }

  new_length(len) {
    for(var i = 0; i < len; i++) {
      this.references[i].classList.remove('inactive');
    }
    for(var i = len; i < this.references.length; i++) {
      this.references[i].classList.add('inactive');
    }
    this.length = len;
  }

}

