function processNodeForEmoji(nd) {
    var s = nd.innerHTML.slice();
    // console.log(s);
    matcher.reset();
    for(var j = 0; j < s.length; j++) {
      if(matcher.next(s[j]) == true) {
        k = matcher.curr_word();
        y = map.get(k);
        var ui = s.slice(j + 1, s.length);
        var ub = s.slice(0, j - (k.length + 1));
        s = ub + y + ui;
        // console.log(ub + ", " + y + ", " + ui)
        // console.log(s);
        j -= (k.length - y.length + 1);
      }
    }
    if(s != nd.innerHTML) {
      nd.innerHTML = s;
    }
    // console.log("Replaced a message")
}

